import React, {useState, useEffect} from 'react';
import Badges from '../pages/Badges';
import Badge from '../components/Badge2';

const App2 = () => {
    const [ images, setImages ] = useState({ mylist: [], condena: [], nicolas: [] });

    useEffect(() => {
        fetch('http://localhost:3000/initalState')
        .then(response => response.json())
        .then(data => setImages(data))
    }, []);

    return (
        <div className="App">

            {images.mylist.length > 0 &&
            <Badges title="Condena" >
                <div className="Badges__boxing"> 
                       <Badge />
                       {/* <Badge2 />
                       <Badge3 />
                       <Badge4 /> */}
                     </div>
            </Badges>
             }
    </div>
    )
}

export default App2;
